import React, { Component } from 'react';
import './App.css';

const Task = (value) => {
  return (
    <li>{value}</li>
  );
}

const tarefas = ['Acordar', 'Tomar café', 'Escovar os dentes', 'Ir trabalhar'];

class App extends Component {
  render() {
    return (
      <ul>{ tarefas.forEach(tarefa => Task(tarefa)) }</ul>
    );
  }
}

export default App;
